                values: new object[,]
                {
                    { new Guid("1a3003af-9694-438c-9926-c3e4ef7da5c3"), "fazehat3r", "FaZe had a disastrous start to their BLAST.tv Paris Major Legends stage campaign, dropping back-to-back best-on-ones to Heroic and, shockingly, Into the Breach to end up on the brink of elimination at the end of day one.\r\n\r\nThe European combine bounced back on day two with a best-of-three victory over 9INE, but were then matched against a familiar demon: Bad News Eagles.\r\n\r\nFlatron \"⁠juanflatroo⁠\" Halimi's side has twice played spoiler to FaZe, once at the IEM Rio Major in the 1-2 round to eliminate Finn \"⁠karrigan⁠\" Andersen's side from contention, and again at the BLAST.tv Paris Major Europe RMR, ultimately leading to FaZe getting cast down to the Last Chance Qualifier, where they only just managed to scrape through to make the Major.", new DateTime(2023, 5, 17, 14, 10, 10, 288, DateTimeKind.Local).AddTicks(4521), "https://img-cdn.hltv.org/gallerypicture/mecDmr3C9bBh-5hysrymiq.jpg?auto=compress&fm=avif&ixlib=java-2.1.0&m=%2Fm.png&mw=107&mx=20&my=474&q=75&w=800&s=54a487de18e27c208a781ba0fd681103", new Guid("99a7b13a-3be9-49d8-a686-6c2fe370658d"), new Guid("12c3d6f9-71e1-499f-b4f6-051a850cb3fd"), "karrigan: \"Beating Bad News Eagles now is slaying our demons\"", null, null },
                    { new Guid("2efbdc5f-e12e-4329-b62c-181b1adef6aa"), null, "FaZe become the first international lineup to win a Major, besting the holders Natus Vincere 2-0\r\n\r\nNatus Vincere crumble under the pressure, something no one expected to happen, and FaZe bring it home.\r\n\r\nFinn \"⁠karrigan⁠\" Andersen finally wins his Major, after years of heartbreak and near misses, and it took a monumental performance from Håvard \"⁠rain⁠\" Nygaard to get it done.\r\n\r\nOnce FaZe get themselves another buy, they get rain through secret and he finds a kill, throwing the Natus Vincere defence into chaos. Despite things coming down to a 2v1 for FaZe with both members on less than 20 health, they manage to close it out.\r\n\r\nThis gives FaZe a chance to break the economy but they can't find the round needed in the follow up, and thus Natus Vincere get a few weaker buys to drag themselves close.\r\n\r\nHOWEVER, a pacy upper execute with Tec-9s bears fruit for FaZe, once again relying on a monster play from rain to bring things home.", new DateTime(2022, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), "https://img-cdn.hltv.org/gallerypicture/0aAYFwGGz_WqZcs089YBqV.jpg?auto=compress&fm=avif&ixlib=java-2.1.0&m=%2Fm.png&mw=107&mx=20&my=473&q=75&w=800&s=55a2e7aa2644b88ee60cbfd5bbffdef7", null, new Guid("12c3d6f9-71e1-499f-b4f6-051a850cb3fd"), "FaZe defeat NaVi 2-0 to win PGL Major Antwerp", null, null },
                    { new Guid("58b68cf0-9622-42f0-82bc-97c2f71e72b8"), "", "\"We're not getting overconfident, but we have our own confidence to win games,\" YEKINDAR says.\r\n\r\nLiquid look like a team on a mission having gone up to the 2-0 pool in the first day of the BLAST.tv Paris Major's Legends Stage. From an 0-2 start in the Challengers Stage, the North American side is now just one best-of-three victory away from qualifying for the playoffs after taking out 9INE and Natus Vincere in two very convincing displays.\r\n\r\n\r\nYEKINDAR cheers as Liquid start their Legends Stage run with a clean 2-0\r\nAfter the perfect start in the Legends Stage, in which Liquid didn't give up double digits in either of their wins, Mareks \"⁠YEKINDAR⁠\" Gaļinskis — who dismantled NAVI with a 2.00 rating — took some time to answer questions about Liquid's clean start, their victory over Natus Vincere, and what it took to get the team rolling after a slow first day in the tournament's previous stage.", new DateTime(2023, 5, 17, 14, 10, 10, 288, DateTimeKind.Local).AddTicks(4552), "https://img-cdn.hltv.org/gallerypicture/LBIN66PWjmkN-aw3NtxH4z.jpg?auto=compress&fm=avif&ixlib=java-2.1.0&m=%2Fm.png&mw=107&mx=20&my=474&q=75&w=800&s=5961fe0b84c8a2996db7358c3d774f32", new Guid("c8ca7498-308d-489e-aed7-f284bb1d406b"), new Guid("07abe581-2bff-4450-b4cb-2fd041192df2"), "YEKINDAR: \"We always believed in ourselves, even when we started 0-2\"", null, null },
                    { new Guid("6370786f-670b-459b-be33-07661782180a"), "heroiclover", "After months of struggles to raise enough capital to continue operations, the Heroic Group is on the horizon of going private under a new owner.\r\n\r\nA key threshold of the sale has been met\r\n\r\nShareholders representing over 75% of all shares in Heroic Group have now signed purchase agreements with the to-be new owner, Krow Bidco AS, meeting the threshold necessary for the acquisition. The buyer is now expected to launch an offer for the acquisition of the remaining shares, according to the release.\r\n\r\nAccording to a Monday release on the Norwegian stock market, the Heroic Group has entered into an agreement for Krow Bidco AS to launch an offer to buy all outstanding shares of the company and recommended its shareholders to accept the offer.\r\n\r\nExpected to be completed in June, the offer stands at 2 NOK (~$0.19) per share, with the total value of all shares amounting to nearly 56 million NOK (~$5.2 million). Shareholders including the company's current board and management representing around 42% of all shares have already signed conditional purchase agreements, which will come into effect if the new buyer enters such agreements to acquire 75% of all outstanding shares.", new DateTime(2023, 5, 17, 14, 10, 10, 288, DateTimeKind.Local).AddTicks(4530), "https://img-cdn.hltv.org/gallerypicture/b0rQLpG1HS76BQf3ZLtuHt.jpg?auto=compress&fm=avif&ixlib=java-2.1.0&m=%2Fm.png&mw=107&mx=20&my=474&q=75&w=800&s=8c809fb411d95b06a753b4eb974d4c72", null, new Guid("2384fe1e-fbb5-4ba2-8129-7e81a811df60"), "While HEROIC compete in Paris, the company is in the process of being sold", new Guid("7c683765-d1ee-4398-b318-a927ccf47a9f"), null },
                    { new Guid("6cd78992-5ec8-4952-93aa-64e05263318c"), null, "Enjoy some of the best highlights from Oleksandr \"⁠s1mple⁠\" Kostyliev's record-breaking MVP performance at the BLAST Premier World Final.\r\n\r\nThe BLAST Premier World Final saw Natus Vincere close the season with another title, pulling off a run from the first round of the lower bracket to maintain their dominance in the latter half of the year and enter the off-season as the undisputed best team in the world.\r\n\r\nAs usual, s1mple was the main man behind the CIS team's success as the BitSkins.com MVP of the tournament, earning his eighth award in NAVI's eighth title run in 2021 to break Nicolai \"⁠device⁠\" Reedtz's record for most medals earned over the course of a calendar year and match the Dane's 19 career MVPs.\r\n\r\nIt wouldn't be s1mple if he didn't pull off some jaw-dropping plays throughout the tournament, the best of which we compiled in a highlight video produced by Filip \"filq\" Szatkowski.", new DateTime(2021, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), null, new Guid("d579f538-8c8a-45e9-b78f-8b9b5bba1a9b"), null, "s1mple - MVP of Blast Premier World Final", null, "https://youtu.be/Amid1ZqPtvg" },
                    { new Guid("90201708-123b-4982-9bfd-3bafe5aef578"), "", "Nikola \"⁠NiKo⁠\" Kovač landed in Paris as one of the best and most-storied players in CS:GO to never have won a Major title, and that is something that will never change. The Bosnian superstar has been eliminated from the BLAST.tv Paris Major in the Legends stage following a loss to fnatic in the 1-2 pool, cementing his name in the history books as the superstar who never took things over the line.\r\n\r\nHLTV spoke to NiKo after the heartbreaking loss, with the 26-year-old sharing his feelings on the early elimination and how he feels about never winning a CS:GO Major.", new DateTime(2023, 5, 17, 14, 10, 10, 288, DateTimeKind.Local).AddTicks(4541), null, new Guid("c356516d-97a7-45b2-9ce2-1646e12ab822"), new Guid("bda4bc3e-2d71-4525-8770-b4ed5aeda775"), "niko: \"I did not deserve to win a major in CS:GO\"", new Guid("7c683765-d1ee-4398-b318-a927ccf47a9f"), "https://youtu.be/9Odnx1UXqfE" },
                    { new Guid("c0bc0a71-2a8e-4f17-867c-5c4cb0212b7e"), null, "The Dane briefly spoke to us after Ninjas in Pyjamas' elimination from the BLAST.tv Paris Major.\r\n\r\nNinjas in Pyjamas crumbled in their 2-2 qualifying match for the BLAST.tv Paris Major playoffs, conceding an 0-2 defeat to Apeks after letting slip an immense lead on Ancient. The European combine held a 14-3 lead on the map before a disastrous T-side effort allowed Damjan \"⁠kyxsan⁠\" Stoilkovski's side to comeback and secure victroy in overtime.\r\n\r\nKristian \"⁠k0nfig⁠\" Wienecke had a quick word with HLTV in the mixed zone to give some early thoughts on the loss, something which Ninjas in Pyjamas took some quick time to discuss before coming into the interview area.", new DateTime(2023, 5, 17, 14, 10, 10, 288, DateTimeKind.Local).AddTicks(4584), "https://img-cdn.hltv.org/gallerypicture/AQob_mtyOnkT5Nc2eJ4uOx.jpg?auto=compress&fm=avif&ixlib=java-2.1.0&m=%2Fm.png&mw=107&mx=20&my=474&q=75&w=800&s=5b0fbb7f11e13d134da10f12ab77e9f7", new Guid("d1723b3e-50a4-4789-adda-66057e8e6136"), new Guid("1a6d45ce-3829-420a-b848-a82d5599383e"), "k0nfig: \"We did not trust the players and only trusted the stratbook\"", null, null },
                    { new Guid("c1a9d066-66a0-44a5-8939-675441baf6ad"), null, "FaZe are the sixth team to secure a spot in the BLAST.tv Paris Major 2023 playoffs after defeating Natus Vincere in the 2-2 decider match. The European squad successfully recovered from a catastrophic 0-2 start to the second group phase with three consecutive best-of-three victories to advance.\r\n\r\n\"We started to choke, we started to be nervous,\" said coach Andrey \"⁠B1ad3⁠\" Gorodenskiy in the post-match interview. \"People forgot what to do, threw another smoke, or forgot their roles... that's very important because when you play against FaZe you have to play at the top of your concentration.\"\r\n\r\nThe loss put an end to Natus Vincere's journey at the last CS:GO Major after a disappointing run in the Legends Stage. Their journey was marked by defeats to Liquid and an 0-2 collapse against Monte, losses which sent the Ukrainian squad to the elimination series.\r\n\r\nRobert \"⁠RobbaN⁠\" Dahlström's men will finally breathe a sigh of relief after a tense run to the knockout stage. FaZe's qualification for the playoffs started with an 0-2 record against Heroic and Into the Breach on the first day, but successfully recovered with wins over 9INE and Bad News Eagles to go into the decider fixtures.\r\n\r\nMeanwhile, Natus Vincere were eliminated in the group stage of a Major for the fourth time in their Global Offensive history and the first since PGL Krakow 2017, when they were eliminated by fnatic with a 1-3 record.", new DateTime(2023, 5, 17, 14, 10, 10, 288, DateTimeKind.Local).AddTicks(4571), "https://img-cdn.hltv.org/gallerypicture/67VLw_4vyllf4LBAHQIP-P.jpg?auto=compress&fm=avif&ixlib=java-2.1.0&m=%2Fm.png&mw=107&mx=20&my=474&q=75&w=800&s=e66211fd14e717bef31b796905a15938", null, new Guid("12c3d6f9-71e1-499f-b4f6-051a850cb3fd"), "FaZe eliminate NAVI and clinch Paris Major playoffs spot", null, null },
                    { new Guid("dcee0b0a-e671-4c20-ad3b-49afb50dccd1"), "Striker", "After a mostly upset-less day two, the third day of play was a complete turnaround. ENCE, who were sent down to the 1-2 pool in Paris after a shock defeat to Into the Breach, were sent packing early on in the day following a resounding 0-2 loss to a well-playing Ninjas in Pyjamas.\r\n\r\nThe Nordic mix were in control for much of the fixture, handing the Marco \"⁠Snappi⁠\" Pfeiffer-led squad a 16-7 hounding on Mirage before wrapping things up with a 16-10 scoreline on Ancient to force the European roster to exit the Major in 12-14th place despite a flawless 3-0 run in the Challengers Stage.", new DateTime(2023, 5, 17, 14, 10, 10, 288, DateTimeKind.Local).AddTicks(4458), "https://img-cdn.hltv.org/gallerypicture/7khd16wLnP5z8ohpLp5PZR.jpg?auto=compress&fm=avif&ixlib=java-2.1.0&m=%2Fm.png&mw=107&mx=20&my=474&q=75&w=800&s=f7b78f58b2fbeb02410f312b6732bd7b", null, new Guid("bda4bc3e-2d71-4525-8770-b4ed5aeda775"), "Heavyweights in ENCE and G2 bow out", null, null },
                    { new Guid("e07dad9f-656a-411c-9027-8d6a0439c128"), null, "Relive Håvard \"⁠rain⁠\" Nygaard's top moments from the PGL Major in Antwerp with our highlight movie following his MVP run.\r\n\r\nrain became a Major MVP by outgunning all of the young stars on the stacked FaZe at the PGL Major in Antwerp, ending with a 1.24 rating and an astonishing 1.47 impact rating as a kicker. It was in the grand final against Natus Vincere, where he got a 1.49 rating by taking over the server on Nuke with 30 frags that rain secured the hardware.\r\n\r\nThis is rain's first MVP award since the ECS Season 4 Finals in Cancun, Mexico, and the third in his career as the 27-year-old player put forth a vintage performance in Belgium to once again take home a medal for his individual prowess.\r\n\r\nWatch the two-minute highlight reel from the event put together by Ayush \"AwptiX\" Kumar featuring rain's top moments from FaZe's matches against Natus Vincere, Cloud9, Ninjas in Pyjamas and Copenhagen Flames.", new DateTime(2022, 5, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), "https://img-cdn.hltv.org/gallerypicture/Fz2VB7mLF6NLkc6klhb2iZ.jpg?auto=compress&fm=avif&ixlib=java-2.1.0&m=%2Fm.png&mw=107&mx=20&my=473&q=75&w=800&s=498077fc8e9074ddd4fa2e2c173ca4ca", new Guid("de76152a-9993-43ac-839f-348015ad944f"), null, "rain - MVP of PGL MAJOR ANTWERP", null, "https://youtu.be/m9JQ2HYu1VI" }
                });

